import './style.css';
import ProfileIcon from '../../assets/profile-icon.svg';
import CloseIcon from '../../assets/close-icon.svg';

function ProfileBar() {
    return (
        <div>
            <img src={ProfileIcon} alt="Icon" className="icon" />
        </div>
    )
}

export default ProfileBar;
